import {useParams } from 'react-router-dom';

const SatisfactionIndex = () => {
    const {index} = useParams();
    alert(index)
    return (
        <div>
                 <span className="text-muted">Employee Satisfaction Index : </span>{index}

        </div>
    )
}

export default SatisfactionIndex
